Andrew was a lefty, but it wouldn't surprise me if he trained himself to be ambidextrous for the sake of gaming. Anyone that knew him, knew his love of gaming was a close second to skateboarding. I could never get into it, no matter how much he tried to lure me. I wish I had taken the time to learn more about how amazing WoW was, and why it was so rewarding that it required 20 hour binges of deep complex total commitment. He'd be sitting at his desk, wrapped up in his blankie, tapping his feet because he had to pee so bad, but couldn't break away from the game for 40 seconds üòÜ He never grew out of it, and only got better and more focused as he became an adult. Though as he matured, he definitely learned how to better balance his time, and passions. 
